  `developer_name` varchar(255) DEFAULT NULL,
  `developer_phone` varchar(20) DEFAULT NULL,
  `accessories_id` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

