insert  into `open_dynamic`(`id`,`title`,`content`,`del_flag`,`release_time`) values ('7733573a30fc4106847cb2b091d74ba0','飞翔的精灵','<p><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp; &nbsp;雪，越下越急。窗户木格的角落里，堆起了积雪。冬日的天空灰蒙蒙的一片。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 忽然，一只小鸟扑腾着飞进院子，跌跌撞撞地落在雪里，嘴巴朝下栽倒在地上。接着又挣扎着站起来，摇摇摆摆地走来走去，不时低头在地上啄一下。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩趴在窗台上，鼻子顶着玻璃，望着这只小鸟，心里想着：晚上能不能避开家里人悄悄溜出去呢？院子里的那张长椅叶落满了雪，应该把它倒扣过来呢......</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/muqin/index1.html\">妈妈</a><span style=\"font-family: Simsun; font-size: 14px;\">在里面喊了她一声，男孩慢腾腾的穿过走廊向厨房走去。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 他走进暖洋洋的门厅，在餐桌旁坐下等着早饭。像往常一样，妈妈又在做简短的饭前</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/ganen/index1.html\">感恩</a><span style=\"font-family: Simsun; font-size: 14px;\">祈祷。男孩心不在焉得用手指甲在旧桌子上划来划去。祈祷一结束，他就拿起勺子，伸进热腾腾的鸡汤面条盆里。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 他把饼干掰开，泡进汤里，勉强抬起眼皮望望对面坐着的</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/meimei/index1.html\">妹妹</a><span style=\"font-family: Simsun; font-size: 14px;\">。妹妹的目光一直在跟随着他的脸转。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 他吃完面汤，又一口气喝干她的牛奶：&ldquo;我可以走了吗？&rdquo;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 妈妈抬起头，迷惑不解：&ldquo;上哪儿？&rdquo;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩不耐烦的盯着妈妈，觉得他早应该知道：&ldquo;我想到池塘那边试试我的新冰鞋。&rdquo;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 妈妈瞥瞥身旁的妹妹，温和地说：&ldquo;稍等几分钟，带上她。&rdquo;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩一把推开椅子，高声叫道：&ldquo;我一个人去，不带她！&rdquo;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; &ldquo;求求你，本杰，你从来不给她一次机会，你也知道，他</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/xihuan/index1.html\">喜欢</a><span style=\"font-family: Simsun; font-size: 14px;\">滑冰。照你的想法，因为他是个哑巴，就可以不理睬她，但这回还是让她跟你去吧。&rdquo;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 一撮灰白的头发垂下来，挂在妈妈苍白的脸上，他疲倦的挥挥手：&ldquo;妹妹的冰鞋在门厅的壁橱里。&rdquo;男孩愤愤的逼视着妈妈和妹妹，声嘶力竭的喊道：&ldquo;我就是不带她！&rdquo;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 说完，他冲到壁橱前，抓起自己的大衣、连指手套和帽子，把门&ldquo;砰&rdquo;的在身后甩上，跑进车库，摘下冰鞋搭在肩上，跑进院子。长椅仍然静静地躺在那里。男孩走上前，把它们掀了个底朝天，</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/weixiao/index1.html\">微笑</a><span style=\"font-family: Simsun; font-size: 14px;\">着朝田野跑去。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩在盖满雪的马食槽上坐下，穿上冰鞋，把换下的鞋系在一起，搭在肩上，朝池塘边走去。他立在池塘边，兴奋得发抖。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 忽然，有一只手扯了扯男孩的大衣，他一惊，低下头，发现了妹妹。他把妹妹按着坐下，盘算了一下，想把妹妹送回去，可又想到，如果这样，会招来更多的麻烦。想到这里，男孩给妹妹穿上冰鞋，她狠心用力拉扯鞋带，抬起眼想看看妹妹脸上有没有怕疼的表情。但是没有&hellip;&hellip;一丝变化也没有，尽管鞋带已经深深的勒进了他的肉里，可他还是静静的坐着，注视着</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/gege/index1.html\">哥哥</a><span style=\"font-family: Simsun; font-size: 14px;\">，两只眼睛一声不响的看到她心底的最深处。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; &ldquo;妈妈为什么不生一个</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/keai/index1.html\">可爱</a><span style=\"font-family: Simsun; font-size: 14px;\">的孩子，却生了个你。&rdquo;男孩瞧着妹妹，好像他是一件累赘讨厌的物品，他甚至因为自己这样恨妹妹而恼恨起自己来。有时，他发现自己甚至记不住妹妹的名字;也许，是他有意忘掉了。他给妹妹系好鞋带，起身走开。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 一阵不大的风刮来，吹透男孩的灯芯绒长裤，他溜到池塘中间，开始滑行，裸露的脚踝在寒风里有种舒服的刺痛。他能感到锋利的刀刃&ldquo;咝咝&rdquo;擦过雪被下的冰面。寒气逼人，冷风吹在她的脸颊和耳朵上，冻得生疼。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩倒退着滑行，看到妹妹从后面跟了上来，他盯着妹妹以优美的姿势朝他滑来，他也知道，自己永远滑不了这么漂亮。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 妹妹的手指动作不很协调，但他却滑得比谁都好。也许正是她的矮小和清瘦让他感到厌恶，这个脸色苍白、灰不溜秋的倒霉东西。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩看着妹妹轻巧的滑过池塘，像一瓣削下来的冰片。他打了个弯，朝前滑去。在停下来擦鼻涕时，他觉得有人在扯她的大衣襟，他一把甩开妹妹的手，朝另一个方向滑去。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 他抬起头，四下寻找他的身影，没有！他划到池塘中间，四下张望，发现妹妹在池塘的另一头，超出了安全区！虽然没有标志，但他知道，那儿冰薄如纸。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 一瞬间，男孩呆住了。可又一转念，一旦出事，很容易解释，他只要对妈妈说当时他不知道妹妹在那儿滑冰&hellip;&hellip;从此，妈妈苍老和疲倦的神情就会从布满皱纹的脸上消去&hellip;&hellip;从此，妹妹卧室里就再也不会传出一遍又一遍耐心和气的劝说；再不会有妹妹拒绝自个儿学着系鞋带时，妈妈脸上出现的那种无可奈何的神情；也再不会见到妈妈的</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/yanlei/index1.html\">眼泪</a><span style=\"font-family: Simsun; font-size: 14px;\">&hellip;&hellip;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩目不转睛，看着妹妹越滑越远。忽然，一只小鸟闯进了她的视线，那是一只笨拙的雪鹀。此刻，他显得更加纤弱，却飞得那么漂亮，他慢慢掠过池塘。男孩正要仔细瞧瞧，他却消失了，但刹那间他还是看清了，他就是早晨在院里见到的那只小精灵！</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩的两腿开始加速蹬踩，冰刀发狂的凿在冰面上。妹妹不见了！男孩十分焦急，双腿像着了火，他挥舞双臂，竭力想加快速度，总觉得不够快。泪水从他的眼眶里涌出来。妹妹不见了！他竟然眼睁睁的看着它滑到薄薄的冰面上。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 接着，他听到冰层的巨大断裂声，并且感受到了冰面的震颤。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩拼命滑到塌陷的冰窟边缘，小心得爬在冰上，一把抓住了妹妹大衣的后襟，冰凉的水立刻冻僵了她的手指，他紧紧攥住，用尽全身力气往上拉。妹妹的头出现了，但大衣却从他手里滑了出去，妹妹又向下沉去。</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/juewang/index1.html\">绝望</a><span style=\"font-family: Simsun; font-size: 14px;\">中，他把两只胳膊都伸进水里，疯了似的连摸带抓，终于又把大衣抓在了手里，这回，把妹妹拽出了冰面。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 仿佛过了很长时间，他盯着妹妹发青的脸，默默祈告他的眼睛能很快睁开。妹妹终于慢慢睁开了眼睛。他的心一阵绞痛。妹妹浑身发抖，男孩迅速地脱下他湿透了的衣服，把她瘦小的身体紧紧裹在自己的大衣里。他用冻僵的手脱下自己的滑冰短袜，套在妹妹的脚上。刺骨的寒气立刻顺着他的脚心爬了上来。</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 冻僵的双手怎么也解不开鞋带，他把它们胡乱套上，抱起妹妹，朝岸上跑去。怀里的妹妹，身体僵硬。他注意到妹妹的嘴唇被划破了，在流血，就从口袋里掏出纸巾，为他擦干血迹。她低下头，想从妹妹的眼睛里找出什么表情，但仍然什么也没有&hellip;&hellip;</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 没有</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/tongku/index1.html\">痛苦</a><span style=\"font-family: Simsun; font-size: 14px;\">，没有责备，什么也没有&hellip;&hellip;只有眼泪。可从前，她未曾看见妹妹哭过一次，尽管有的时候，妈妈在妹妹的面前</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/shangxin/index1.html\">伤心</a><span style=\"font-family: Simsun; font-size: 14px;\">得死去活来，他依然是无动于衷的呆坐着。可现在，她眼眶里涌出了泪水，泪珠从脸上流了下来。男孩终于想起了她的名字&mdash;&mdash;谢丽尔！</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 他挣扎着往哥哥</span><a style=\"color: #333333; text-decoration: none; font-family: Simsun; font-size: 14px;\" href=\"http://www.duwenzhang.com/huati/wennuan/index1.html\">温暖</a><span style=\"font-family: Simsun; font-size: 14px;\">的身上挤，男孩用尽力气把她紧紧搂抱在怀里，他注视着妹妹，轻轻呼唤着他的名字。终于，他发现妹妹的眼里流露出一丝柔情，他认出了自己的哥哥！</span><br style=\"font-family: Simsun; font-size: 14px;\" /><span style=\"font-family: Simsun; font-size: 14px;\">&nbsp;&nbsp;&nbsp; 男孩加快了脚步，朝家里走去。</span></p>',1,1494206881206),('286ad8b145de48f0aeac9a6073dd25f5','人到中年的感悟','<p style=\"font-family: Simsun; font-size: 14px;\">生本<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/pingdan/index1.html\">平淡</a>，活着也平淡。就带着一份无波无澜的平常，一点点走过<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/qingchun/index1.html\">青春</a>的岁月。<br />看不见<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/aiqingwenzhang/\">爱情</a>的影子，只好把它紧紧地攥在手心。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">三十以后，已经成了一头负重的黄牛，在清晨，在傍晚，发出一阵阵疲惫的呻吟，却不知道在哪里憩息。<br />日子，蜷在一杯温吞吞的水里，把所有的时间，浸泡的发白，毫无生气。<br />手攥着始终不忍抛弃的爱情，徘徊在门楣之外。门里，是一片起起落落的睡梦，但却没有自己。<br />想找一片草地，晒一晒太阳；想找一片太阳，晾一晾自己；想找找自己，看还能不能把爱情裁成一件御寒的衣裳。<br />看天空，云静静的飘过，风轻轻的划过，飞鸟的翅膀，剪落一阵冰凉的咸咸的雨。<br />看脚下，水，积成了一面镜子，那里面，游弋着一条<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/meili/index1.html\">美丽</a>的彩虹，鲜润，丰美。<br /><br />敞开一直紧握的手掌，爱情，翻一翻身，化成了一只鸟儿，立在自己的肩头，向着雨后的阳光，向着草地的那一头，向着逐渐靠近的彩虹，啁啾而歌。<br /><a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/wennuan/index1.html\">温暖</a>，是一种贴心的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/ganjue/index1.html\">感觉</a>，渐渐的弥漫。<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/weixiao/index1.html\">微笑</a>，是一种明亮的色彩，慢慢的展开。<br />兴奋，是一种揪心的疼爱，缓缓的溢出。激动，是一种苦苦的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/dengdai/index1.html\">等待</a>，盈盈的走来。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">走过三十以后的眼睛看见了，走过三十以后的手指触到了，在自己的手心里紧紧攥了三十年的爱情，羽化成一片葳蕤的花丛，迎风招展，流芳溢彩。不要再看自己的影子有多短，不要再看自己的脚步有多长，去吧，走进那一片丰茂的原野，走进那一双凝视的目光，自己今后的岁月，将重新演绎，开满欢乐的花朵。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">走过三十以后，才明白，自己手心里紧紧攥着的爱情，是一份满满的期待。<br />走过三十以后，才知道，自己手心里紧紧攥着的爱情，是一片灼灼的阳光。<br />走过三十以后，才知道，心不死，愿活着，就能绽开动人的笑脸。<br />走过三十以后，才知道，以后的日子，还很长，还很多。</p>',0,1488772776264),('fdf9758bfc024f6fa392982cdd0b2cfe','文字，斑斓了心灵','<p style=\"font-family: Simsun; font-size: 14px;\">　　岁月如烟，流年似锦。一份烟火，一度春秋。左手染墨，右手繁华。只言片语，哪能写得尽五味<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/renshengzheli/\">人生</a>？只道是文字如弦，拔动心的音律。用文字记录花的芬芳，美妙心的花朵，绽放楚楚动人的姹紫嫣红，在流年深处，让文字的河流浅浅流淌，流过花朵依然芳香的冬夏，流过灯火阑珊处那个我日夜<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/sinian/index1.html\">思念</a>的他，流过绚烂如梦的年华，在心底留下深深浅浅的足迹。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　这个世界，唯文字可与<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/shengming/index1.html\">生命</a>相媲美。文字，活色生香，生命，踏过茉莉一样的芳香，遇见一份柔情，辗转一念<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/zhizhuo/index1.html\">执着</a>；文字，如梦似幻，生命，跨过童话一般的世界，美妙一份梦幻，陶醉一份<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/wenxin/index1.html\">温馨</a>；文字，五味人生，生命，尝过酸甜苦辣，遥看一席芳华，落满轻舞飞扬的缤纷枝叶，在风景如画的年华，筑起一份<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/jianqiang/index1.html\">坚强</a>与洒脱，如痴如醉，笑看人生。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　一不小心，爱上了文字，将它深深地永存于心底；一不小心，跌落文字的温柔乡，让它吻我千百遍；一不小心，跌落在文字的芬芳里，沉醉不知归路；一不小心，跌落在文字的花海里，看不尽的诗词歌赋，<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/xiangshou/index1.html\">享受</a>不尽的唐风宋雨；一不小心，跌落在文字的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/\">故事</a>里，入神地听它讲缠绵悱恻的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/aiqingwenzhang/\">爱情</a>，听它讲如诗如画的家乡风景。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　文字，与它一生一起走，走过斑斓的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/tongnian/index1.html\">童年</a>，走过<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/kuaile/index1.html\">快乐</a>的少年，走过多雨的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/qingchun/index1.html\">青春</a>，它，还将伴我走过丰富的中年。文字，与它一生一起走，走过生机勃勃的春季，走过生机盎然的夏季，走阳光明媚的秋季，走过白雪皑皑的冬季。文字，与它一生一起走，走过锅碗瓢盆奏响的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/shenghuosuibi/\">生活</a>，走过袅袅炊烟升起的乡愁，走过执子之手，与子偕老的温馨。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　轻轻地，如一首儿歌，文字是那样轻柔缱绻，在我的生活里扮演着<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/muqin/index1.html\">母亲</a>的角色；轻轻地，如一首快乐的歌，文字是那样的轻松愉悦，在我的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/xinling/index1.html\">心灵</a>里种下快乐的种子；轻轻地，如一首悠扬的歌，文字是那样轻缓美妙，在我的心灵里种下<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/langman/index1.html\">浪漫</a>的种子；轻轻地，如一首简单的小情歌，文字是那样寂静欢喜，在我的心灵里种下默然守候的种子。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　静静地守候一份爱，那年，那月，那一天，当这份爱黯然飘逝，那份缱绻的旧时光，我把它安放在文字里，安放在小小的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/xinqingriji/\">日记</a>本里，安放在心里，一直未能抹去。爱情，芬芳了流年，灿烂了旧时光，供养了文字。文字，让我把这份可贵的爱情铭刻在岁月的尾端，铭刻在柔情似水的骨子里，铭刻在真爱永存的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/linghun/index1.html\">灵魂</a>深处。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　半辈子，<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/yongyou/index1.html\">拥有</a>了很多：<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/fumu/index1.html\">父母</a>无私的爱，真挚的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/youqingwenzhang/\">友情</a>，刻骨的爱情，<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/wennuan/index1.html\">温暖</a>的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/qinqingwenzhang/\">亲情</a>，精彩的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/mengxiang/index1.html\">梦想</a>。当人生的冬季到来，我的绚烂的青春，我<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/meili/index1.html\">美丽</a>的年华，我健康的身体，全都埋在冰雪下。<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/neixin/index1.html\">内心</a>深处，苦不堪言。是文字，让我的人生春暖花开；是文字，让我的拥有了第二个<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/chongshi/index1.html\">充实</a>的青春；是文字，妩媚了我的心灵；是文字，驱逐了我的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/beishang/index1.html\">悲伤</a>；是文字，愉悦了我的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/wenzhang/xinqingriji/\">心情</a>；是文字，精彩了我的人生。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　文字，是四季里的花朵，美丽了我的人生。文字，是春天里的茉莉花，鲜嫩粉白，妖娆可人，它淡淡的清香，让我陶醉；文字，是夏天里的荷花，它美若天仙，倾国倾城，它红红的脸，白白的身，它散发的幽幽的气息，让我无可救药的爱上了它；文字，是秋天里的杜鹃花，燃烧着粉色的火焰，燃烧着粉色的灿烂，燃烧着盎然的斗智，燃烧着秋天明媚的气息，让我沉醉；文字，是冬天里的红梅，它小小的身体里，蕴含着火一样的深红，蕴含着坚强与无畏，蕴含着<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/xiwang/index1.html\">希望</a>与无限的生命力，它的品格，它的意志，它的灵魂，让我开启了人生的第二个春天。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　文字，让我的生命开满了花朵，浸满了花香；让我的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/youyi/index1.html\">友谊</a>细水长流，暖如春阳；让我的爱情在心里滋长，甜美如花；让我的梦想悄悄地开花，精彩纷呈。文字，与悲伤有关，但始终快乐有染；文字，与<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/jimo/index1.html\">寂寞</a>有关，但始终与热情并存；文字，与<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/tongku/index1.html\">痛苦</a>有关，但始终与温暖同在；文字，与多愁善感有关，但始终让人充满希望；文字，与恨有关，但始终让人<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/huati/aixin/index1.html\">爱心</a>满满。</p>\n<p style=\"font-family: Simsun; font-size: 14px;\">　　流年似水，岁月安暖。文字，温暖了岁月，芬芳了生命，丰富了灵魂。文字，是一生最妩媚的花朵，是一生最美丽的风景，是一生最柔软的<a style=\"color: #333333; text-decoration: none;\" href=\"http://www.duwenzhang.com/\">情感</a>。文字，悄悄地来到我身旁，伴我走过荷塘月色，走过小桥流水，走过江南烟雨，走过锦绣河山，走过一生一世。在文字里，做一朵小花，看日出日落，云卷云舒。文字，相伴一生，让我不悔流年；文字，馨香生命，让我花开绚烂；文字，斑斓心灵，让我心花怒放。</p>',0,1488772843025),('455f3fff8e2e495abfe05598e89e99a8','哈哈哈哈','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;人工费过热个外国人个人体感染干扰greg如果如果不认识恶搞热死个人身份过生日不v发哈哈哈哈啊哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈哈啊哈哈哈哈哈</p>',0,1114201881206),('20909b5cdbc54f9d98069ac3f4c6fbee','领事馆签证大使馆','<div id=\"branding\">\n<div id=\"logo\" style=\"background-image: url(\'../../resource/1141086765/images/logo.gif\'); background-position: 0px 20px; background-size: initial; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><a href=\"http://www.china.diplo.de/Vertretung/china/zh/Startseite.html\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;德意志联邦共和国<br />驻华使领馆 </a> <a href=\"http://www.china.diplo.de/Vertretung/china/zh/Startseite.html\"> <br /> </a></div>\n<div id=\"head\">\n<div id=\"nav-meta\">\n<ul>\n<li class=\"language\" lang=\"de\"><a href=\"http://www.china.diplo.de/Vertretung/china/de/Startseite.html\"> Deutsch </a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/Startseite.html\">首页</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/Sitemap.html\">网站地图</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/Newsletter.html\">新闻简报</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/Kontakt.html\">欢迎联络</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/RSS-uebersicht.html\">RSS</a></li>\n</ul>\n</div>\n<div id=\"search-box\"><img src=\"http://www.china.diplo.de/contentblob/4694702/BildDaten/7230183/1BannerG20links.jpg\" alt=\"\" /> <img src=\"http://www.china.diplo.de/contentblob/4694704/BildDaten/7230190/1BannerG20rechts.jpg\" alt=\"\" />\n<h2>Suche</h2>\n<form id=\"searchForm\" action=\"http://www.china.diplo.de/Vertretung/china/zh/Suche.html\" method=\"post\"><fieldset><label for=\"suchen\">搜索</label> <input id=\"suchen\" accesskey=\"4\" title=\"请输入检索词\" name=\"q\" type=\"text\" value=\"\" /> <input class=\"button\" alt=\"suchen\" src=\"http://www.china.diplo.de/resource/1436830383/images/icons/icon-search.png\" type=\"image\" value=\"Suche\" /></fieldset></form></div>\n<p class=\"section\">德意志联邦共和国驻中华人民共和国使领馆</p>\n</div>\n</div>\n<div id=\"nav\">\n<div id=\"nav-box\">\n<h2>主要导航</h2>\n<ul>\n<li class=\"path\"><a href=\"http://www.china.diplo.de/Vertretung/china/zh/Startseite.html\">首页</a></li>\n<li class=\"open\"><span class=\"aural\">您在这里</span> <strong>签证</strong>\n<ul>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/01-schengenvisa/00-schengenvisa-15092015.html\">申根签证</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/02-nationale-visa/00-nationale-visa.html\">长期签证</a></li>\n</ul>\n</li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/03-service/0-hbs.html\">领事处服务</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/04-pol/0-hbs.html\">政治</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/05-wi/0-hbs.html\">经济</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/06-wiss-bildung/0-hbs.html\">科学和教育</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/07-euk/0-euk-chn-hbs.html\">能源、环境、气候</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/08-ku/0-kultur.html\">文化和体育</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/100-peki/0-hbs.html\">德意志联邦共和国驻华大使馆</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/200-chengdu/0-chengdu.html\">德意志联邦共和国驻成都总领事馆</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/201-kanton/0-kanton.html\">德意志联邦共和国驻广州总领事馆</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/202-shan/0-shanghai.html\">德意志联邦共和国驻上海总领事馆</a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/204-shen/0-hbs.html\">德意志联邦共和国驻沈阳总领事馆 </a></li>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/203-hong/0-hongkong.html\">德意志联邦共和国驻香港总领馆</a></li>\n</ul>\n</div>\n</div>\n<div id=\"breadcrumb\">\n<ul>\n<li><a href=\"http://www.china.diplo.de/Vertretung/china/zh/Startseite.html\">首页</a></li>\n<li class=\"last\"><span class=\"aural\">您在这里</span> <strong>签证</strong></li>\n</ul>\n</div>\n<p>&nbsp;</p>\n<div id=\"content\" style=\"margin-top: 0px;\">\n<div id=\"main\">\n<h1>签证申请程序</h1>\n<div class=\"alert\">\n<h2 class=\"label\">重要提示</h2>\n<p class=\"MsoNormal\"><strong lang=\"ZH-CN\">!!! 请您注意,</strong> <strong><strong class=\"color--red\" lang=\"ZH-CN\">德意志联邦共和国驻中华人民共和国使领馆将于2017<span lang=\"ZH-CN\">年</span>05<span lang=\"ZH-CN\">月</span>30</strong><strong lang=\"ZH-CN\"><span class=\"color--red\">日(端午节)闭馆 !!!</span></strong></strong></p>\n</div>\n<div class=\"teaser\">\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\">德国驻中国使领馆提供您<strong>易于简化</strong>的签证申请程序</span><span lang=\"ZH-CN\">。</span></p>\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\">有两种不同类型的签证：</span></p>\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\"><strong>申根签证</strong>允许最多停留</span>90<span lang=\"ZH-CN\">天<br /></span></p>\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\"><strong>长期签证</strong>停留超过</span>90<span lang=\"ZH-CN\">天。</span></p>\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\">我们在以下页面为您整理有关两种不同签证类型，签证申请程序和递交签证申请材料的综合信息。</span></p>\n</div>\n<div class=\"teaser\"><img class=\"photo\" title=\"Schengenvisum (&copy; colourbox)\" src=\"http://www.china.diplo.de/contentblob/3044774/Teaser/1608701/visumschengen2.jpg\" alt=\"Schengenvisum\" longdesc=\"http://www.china.diplo.de/__Zentrale_20Komponenten/____Bilder__neu/Konsularservice/visum-schengen-2?view=as_long_description&amp;site=479513\" />\n<h2>申根签证</h2>\n<ul class=\" checklist\">\n<li><strong><span lang=\"ZH-CN\">最长逗留</span>90天<span lang=\"ZH-CN\">，可申请申根签证</span></strong></li>\n</ul>\n<p class=\"MsoNormal\">&nbsp;</p>\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\">点击这里了解关于申根签证的一般信息、使馆，各总领事馆和我们的服务商中智签证申根签证的申请程序</span></p>\n<p class=\"t-link\"><a class=\"internal\" href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/01-schengenvisa/00-schengenvisa-15092015.html\">申根签证</a></p>\n</div>\n<div class=\"teaser\"><img class=\"photo\" title=\"Visa (&copy; dpa / picture-alliance)\" src=\"http://www.china.diplo.de/contentblob/2429006/Teaser/530473/visum1.jpg\" alt=\"Visa\" />\n<h2>长期签证</h2>\n<ul class=\" checklist\">\n<li><span class=\"gruppe11\"><strong><span lang=\"ZH-CN\">逗留时间超过</span>3</strong></span><span class=\"gruppe11\"><strong><span lang=\"ZH-CN\">个月，须申请德国长期签证</span></strong></span></li>\n</ul>\n<p class=\"MsoNormal\"><span class=\"gruppe11\">-</span> <span class=\"gruppe11\"><span lang=\"ZH-CN\">家庭团聚和子女随迁、赴德结婚（结婚定居）</span></span> <span class=\"gruppe11\"><span lang=\"ZH-CN\">、同性生活伴侣</span></span></p>\n<p class=\"MsoNormal\"><span class=\"gruppe11\">-</span> <span class=\"gruppe11\"><span lang=\"ZH-CN\">语言班、申请大学、留学、学术访问、文化或体育活动</span></span></p>\n<p class=\"MsoNormal\"><span class=\"gruppe11\">-</span> <span class=\"gruppe11\"><span lang=\"ZH-CN\">就业（包括欧盟蓝卡、互惠生、实习和找工作）</span></span></p>\n<p class=\"t-link\"><a class=\"internal\" href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/02-nationale-visa/00-nationale-visa.html\">长期签证</a></p>\n</div>\n<div class=\"teaser\"><img class=\"photo\" src=\"http://www.china.diplo.de/contentblob/4565342/Teaser/5643320/fragezeichen13072015.jpg\" alt=\"\" />\n<h2>问答 / 签证知识</h2>\n<p><span lang=\"ZH-CN\">您有其他问题么?</span></p>\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\">在这里可以找到有关申根签证问答知识详细信息</span>:</p>\n<p class=\"MsoNormal\"><a class=\"internal\" href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/01-schengenvisa/03-faq/00-wissenswertes-ubs.html\" target=\"_top\">详细信息&nbsp;</a></p>\n</div>\n<div class=\"teaser\"><a href=\"http://www.china.diplo.de/Vertretung/china/zh/03-service/konsulatsfinder/s.html\"> <img class=\"photo\" src=\"http://www.china.diplo.de/contentblob/3494770/Teaser/2189384/chinab.png\" alt=\"VR China\" /> </a>\n<h2 class=\"label\"><a href=\"http://www.china.diplo.de/Vertretung/china/zh/03-service/konsulatsfinder/s.html\">使领馆地图</a></h2>\n<p>德国驻华使领馆共六个。为了帮助您更好地找到我们，您可以通过使领馆地图获取各馆地址及联系方式。</p>\n<p class=\"t-link\"><a class=\"internal\" title=\"使领馆地图\" href=\"http://www.china.diplo.de/Vertretung/china/zh/03-service/konsulatsfinder/s.html\"> 使领馆地图 </a></p>\n</div>\n</div>\n<div id=\"extras\">\n<div id=\"fontsize\">\n<h3>字体大小</h3>\n<p class=\"default\"><a class=\"current font\" title=\"普通\" href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/00-visa-hbs.html\" rel=\"normal\">普通</a></p>\n<p class=\"big\"><a class=\"font\" title=\"大\" href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/00-visa-hbs.html\" rel=\"big\">大</a></p>\n<p class=\"huge\"><a class=\"font\" title=\"超大\" href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/00-visa-hbs.html\" rel=\"huge\">超大</a></p>\n</div>\n<div class=\"special-teaser\">\n<div>\n<h3>签证</h3>\n<img title=\"Reisepass (&copy; picture-alliance / Robert B. Fis)\" src=\"http://www.china.diplo.de/contentblob/4014964/Hauptbereichsbild/3588314/visumallgemeinb.jpg\" alt=\"护照\" longdesc=\"http://www.china.diplo.de/Vertretung/china/Bilder/rk/visum-allgemein-b?view=as_long_description&amp;site=479513\" /></div>\n</div>\n<div class=\"teaser social-bookmark\">\n<h3 class=\"social-b\"><a href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/00-visa-hbs.html#bookmarks\">分享</a></h3>\n</div>\n<div class=\"teaser\">\n<h3>签证申请受理中心/周六开放</h3>\n<p><span lang=\"ZH-CN\">在中国</span><span lang=\"ZH-CN\">有供您选择递交申根签证申请和指纹采集的</span><span lang=\"EN-US\">15</span><span lang=\"ZH-CN\">个</span><span lang=\"ZH-CN\">签证中心</span><span lang=\"ZH-CN\">。</span><strong><span lang=\"ZH-CN\">自</span>2016<span lang=\"ZH-CN\">年</span>12<span lang=\"ZH-CN\">月</span>3<span lang=\"ZH-CN\">日起北京, 上海和广州签证中心周六也将</span><span lang=\"ZH-CN\">为您</span><span lang=\"ZH-CN\">开放。</span></strong></p>\n<p class=\"MsoNormal\"><span lang=\"ZH-CN\">更多详情请您参阅 <a class=\"internal\" href=\"http://www.china.diplo.de/Vertretung/china/zh/02-visa/10_20neue_20Visa-Zentren-05022016.html\" target=\"_top\">这里</a></span></p>\n</div>\n<div class=\"teaser\">\n<h3>Visa Information in English</h3>\n<p class=\"MsoNormal\">The German Missions in China ask for your understanding that due to the very small number of English speaking customers, visa information on this&nbsp;</p>\n</div>\n</div>\n</div>',0,1494388193936),('39215f1fa759425c82ba1e8dc565c7aa','测试标题测试标题测试标题测试标题测试标题测试标题测试标题','<p>V但是Vgdfsbdfsrgfregergdfgfgdsfg<span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span><span style=\"font-size: 11px;\">V但是Vgdfsbdfsrgfregergdfgfgdsfg</span></p>',0,1494101111206),('a541dccf54734b3baf8caaa63a894b71','发布一条测试标题，标题内容字数很多很多很多很多很多很多很多很多很多特别的多','<p>内容字数很多很多很多很多很多很多很多很多很多特别的多内容字数很多很多很多很多很多很多很多很多很多特别的多内容字数很多很多很多很多很多很多很多很多很多特别的多内容字数很多很多很多很多很多很多很多很多很多特别的多</p>',0,1494201881206),('5bfef2cd27d3487e891b8c6f96d36eff','我最新发布','<table id=\"post-320192595\" class=\"post topic \" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" data-post-id=\"320192595\" data-is-topic-locked=\"false\">\n<tbody>\n<tr>\n<td class=\"wirter\" rowspan=\"2\" valign=\"top\">\n<dl class=\"user_info \">\n<dt class=\"user_head\" data-username=\"dawenwen1128\"><a href=\"http://my.csdn.net/dawenwen1128\" target=\"_blank\" rel=\"nofollow\"><img class=\"avatar\" src=\"http://avatar.csdn.net/D/4/0/1_dawenwen1128.jpg\" alt=\"dawenwen1128\" /></a></dt>\n<dd id=\"6911639_bbs-btn-attention\" class=\"bbs-user-att\"><a class=\"bbs-btn-blue25 bbs-btn-attention\" href=\"http://bbs.csdn.net/users/6911639/atten