/*Table structure for table `open_platform` */

DROP TABLE IF EXISTS `open_platform`;

CREATE TABLE `open_platform` (
  `id` varchar(50) NOT NULL COMMENT '主键',
  `name` varchar(50) DEFAULT NULL COMMENT '云平台名称',
  `identity` varchar(10) DEFAULT NULL COMMENT '云平台唯一标识',
  `url_app` varchar(60) DEFAULT NULL COMMENT '接收应用推送的地址',
  `del_flag` int(10) DEFAULT '0' COMMENT '删除标识：0未删除，1删除',
  `url_visit` varchar(60) DEFAULT NULL COMMENT '平台的访问地址',
  `create_time` bigint(20) DEFAULT NULL COMMENT '平台注册时间',
  `introduce` text COMMENT '应用介绍',
  `init_status` int(10) DEFAULT NULL COMMENT '初始化状态：0未，1已初始化 2失败',
  `update_time` bigint(20) DEFAULT NULL COMMENT '修改时间',
  `password` varchar(20) DEFAULT NULL COMMENT '推送协商密码',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `open_platform` */

LOCK TABLES `open_platform` WRITE;

insert  into `open_platform`(`id`,`name`,`identity`,`url_app`,`del_flag`,`url_visit`,`create_time`,`introduce`,`init_status`,`update_time`,`password`) values ('1dfdsf','测试云平台','test_plat','http://192.168.199.244:8080/gkPlatform/app/save/fromopen',0,'http://192.168.199.244:8080/gkPlatform/monitor/save',NULL,'测试平台',1,1488765503222,NULL),('1','云平台','YsWbl1','http://192.168.199.244:8080/gkPlatform/app/save/fromopen',0,'http://192.168.199.244:8080/gkPlatform/monitor/save',1487819378065,'　白落梅说过:世间所有相遇，都是久别重逢。那么如今我和你的相遇是前世今生的缘分还是命中注定的情结？\r\n　　\r\n　　伴随着一首首悦耳婉转的小调，脑海中那些细碎而美好的记忆碎片就挣脱束缚，慢慢拾掇粘合。你那清晰的容颜便在脑海中闪烁，发出璀璨耀眼的光芒。与你有关的点滴，穿越时空的局限，再度清晰的浮现在我眼前，那一幕幕暖心的瞬间占据着整个脑海。我想，我和你是多有缘，才能在茫茫人海中与你相遇。\r\n　　\r\n　　仿佛一切都在冥冥之中注定好了。我心持热枕，对文字死心塌地，而你又恰好为我提供了一个展现、提高自己的平台；所以我们正好天生一对。\r\n　　\r\n　　我们因文而结缘。在一笑姐文学艺术群里，我认识了你。我的心被你肚中那一篇篇倾尽情感所撰成的优美文字所牵动，我的眼被那一首首栩栩如生的诗歌画面所感染……欲罢不能的就轻踮了脚尖向你悄悄的靠近靠近，试图走进你，走进有你的世界。\r\n　　\r\n　　在一睹你的芳容之后，这颗交织迷离的心就彻底被你捕获。你，博爱、婉约、诚恳、真实。尽自己的所能给文学爱好者提供着一个相互交流，学习的平台：板块多样、涉略广泛，宽广着我们的视野，每一次用情感幻化成的文字都能得到编辑们精彩的评析，似师长的谆谆教诲，或欣赏或鼓励……一切的一切都盈溢着温馨而美好。\r\n　　\r\n　　邂逅左岸风，享受字里行间洋溢着的情意。冬去春来，四季交替，曼妙生辉，人间冷暖，细品生活；用从血液中流淌出来的文字谱写着生命的赞歌。以我手写我心，以我心书锦年。\r\n　　\r\n　　走进左岸风的象牙塔，不为登顶，而是享受沿途的风景。与不相识却有着同样兴趣爱好的学者们相互交流、学习。以我手书我情，写下初心，岁月静美，一箴一笔足以。',1,NULL,'HziUeB'),('4219e782825a44bb91d6aec66310e870','昆明云平台','luEPw1','http://ynplatform.wulianedu.cc/platform/app/save/fromopen',0,'http://ynplatform.wulianedu.cc',1488443546407,'测试平台3',1,NULL,'vqATIY');

